import React, { useEffect } from "react";
import { Link } from "react-router-dom";
import { EyeIcon, BookIcon, TrashIcon } from '@primer/octicons-react';

function Cards({ deck, cards = [], handleDeleteDeck }) {

    const content = cards.map((card, index) => {
        return (<>
            <div key={index} className="row text-center d-flex justify-content-center mt-1">
                <div className="card w-100">
                    <div className="card-body row">
                        <p className="card-text col-6">FRONT</p>
                        <p className="card-text col-6">BACK</p>
                    </div>
                </div>
            </div>
        </>);
    })

    return (<>
        {content}
    </>
    );
}

export default Cards;
